import React, { useState, useEffect } from "react";

function About() {
  const [data, setData] = useState([]);

  useEffect(() => {
    const apiUrl = 'https://world.openfoodfacts.org/api/v0/product/737628064502.json';

    fetch(apiUrl)
      .then(response => response.json())
      .then(data => setData(data.product.nutriments))
      .catch(error => {
        console.error(error);
      });
  }, []);

  return (
    <div>
     <Card style={{ width: '18rem' }}>
      <Card.Img variant="top" src="holder.js/100px180?text=Image cap" />
      <Card.Body>
        <Card.Title>Card Title</Card.Title>
        <Card.Text>
        <li>Energy: {data.energy_value} {data.energy_unit}</li>
        <li>Protein: {data.proteins_value} {data.proteins_unit}</li>
        <li>Carbohydrates: {data.carbohydrates_value} {data.carbohydrates_unit}</li>
        <li>Fat: {data.fat_value} {data.fat_unit} </li>
        </Card.Text>
      </Card.Body>
      <ListGroup className="list-group-flush">
        <ListGroup.Item>Cras justo odio</ListGroup.Item>
        <ListGroup.Item>Dapibus ac facilisis in</ListGroup.Item>
        <ListGroup.Item>Vestibulum at eros</ListGroup.Item>
      </ListGroup>
      <Card.Body>
        <Card.Link href="#">Card Link</Card.Link>
        <Card.Link href="#">Another Link</Card.Link>
      </Card.Body>
    </Card>
    </div>
  );
}

export default About;
